(62, 'Mengatasi Tantangan Kesehatan Mental Mahasiswa', '<p>Kesehatan mental telah menjadi isu penting yang patut mendapatkan perhatian khusus sejak satu dekade terakhir. Bukan hanya masalah kesehatan mental secara global yang membutuhkan penanganan intensif, melainkan juga tantangan kesehatan mental di kalangan mahasiswa. Gangguan kesehatan mental jelas berpengaruh terhadap kualitas Sumber Daya Manusia (SDM) Indonesia di masa depan.&nbsp;</p>\r\n\r\n<h2><strong>Penelitian tentang Kesehatan Mental Mahasiswa</strong></h2>\r\n\r\n<p>Platform media digital&nbsp;<em>The Conversation</em>&nbsp;melakukan kolaborasi dengan lembaga lainnya untuk melakukan penelitian kesehatan mental di tanah air pada Oktober 2022. Hasilnya, 1 dari 20 remaja Indonesia atau sekitar 2,45 juta jiwa pada rentang usia 10 hingga 19 tahun didiagnosis mengalami gangguan mental.&nbsp;</p>\r\n\r\n<p>Informasi lainnya yang dilansir dari situs Kemdikbud.go.id menyatakan bahwa kini gangguan mental kerap terjadi pada kelompok usia 18-25 tahun. Dengan kata lain, fenomena tersebut berkaitan erat dengan kalangan mahasiswa. Sebanyak 64% generasi muda mengalami masalah kecemasan, sedangkan 61,5% diantaranya sudah mengarah pada gejala depresi. Beberapa tanda gangguan kesehatan mental yang kerap dialami generasi muda, antara lain cemas berlebihan, kemampuan interaksi sosial terganggu, serta gangguan tidur dan selera makan.</p>\r\n\r\n<h3><strong>Mengenal Pentingnya Kesehatan Mental Bagi Mahasiswa&nbsp;</strong></h3>\r\n\r\n<p>Sebagai salah satu universitas dengan&nbsp;<a href=\"https://www.prasetiyamulya.ac.id/program/\">fakultas bisnis terbaik di Indonesia</a>, Prasetiya Mulya (Prasmul) tidak sekadar berfokus pada pengembangan kompetensi mahasiswa. Lebih dari itu, Prasmul turut berusaha mengatasi tantangan bagi kaum akademisi tersebut karena kondisi mental mahasiswa yang sehat akan mendatangkan beberapa manfaat berikut ini:&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Kondisi mental yang sehat membuat mahasiswa fokus belajar sehingga performa akademiknya cenderung baik.&nbsp;</li>\r\n	<li>Konsentrasi dan produktivitas meningkat selama beraktivitas di kampus maupun di luar kampus.&nbsp;</li>\r\n	<li>Relasi yang sehat dengan sesama mahasiswa, dosen, staf kampus, maupun orang-orang terdekat di lingkungan sekitar bisa terjalin baik.&nbsp;</li>\r\n	<li>Punya daya tahan yang baik ketika menghadapi tantangan dan lebih mudah beradaptasi terhadap lingkungan baru, khususnya ketika memasuki dunia kerja.&nbsp;</li>\r\n</ul>\r\n\r\n<h3><strong>Tips agar Mahasiswa Dapat Menjaga Kesehatan Mental di Kampus&nbsp;</strong></h3>\r\n\r\n<p>Prasmul merekomendasikan beberapa tips efektif berikut ini agar kesehatan mental mahasiswa (Prasmulyan) terjaga dengan baik:&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong>Belajar mengelola waktu secara efektif</strong><br />\r\n	Manajemen waktu adalah salah satu kemampuan penting untuk menjaga kestabilan mental mahasiswa. Jangan biarkan kesibukan kampus yang berlebih malah menimbulkan stres. Berusahalah membagi waktu untuk kegiatan kampus, penyelesaian tugas, serta kegiatan lainnya di luar akademik. Menikmati waktu bersenang- senang di luar aktivitas kuliah tentu sama pentingnya dengan pencapaian prestasi di kampus.&nbsp;</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><strong>Jaga kesehatan fisik</strong><br />\r\n	Jangan lupa bahwa kesehatan fisik juga erat kaitannya dengan kesehatan mental. Kondisi fisik yang kurang prima membuat Prasmulyan jadi rentan lelah hingga akhirnya mengalami stres. Oleh sebab itu, Prasmulyan patut menjalani pola hidup sehat secara konsisten untuk menjaga kesehatan fisik. Konsumsi makanan bergizi, olahraga rutin, dan istirahat cukup akan membuat Prasmulyan lebih berenergi sehingga kondisi mental pun jadi stabil dan siap menghadapi berbagai tantangan.&nbsp;</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><strong>Bersosialisasi dan menjalin relasi melalui himpunan mahasiswa</strong><br />\r\n	Reputasi sebagai kampus dengan&nbsp;<a href=\"https://www.prasetiyamulya.ac.id/program/\">jurusan manajemen bisnis terbaik di Indonesia</a>&nbsp;tidak lantas membuat Prasmul mudah puas. Hingga saat ini Prasmul masih terus berupaya melakukan berbagai inovasi yang berorientasi pada kepentingan mahasiswa, salah satunya melalui keberadaan berbagai himpunan mahasiswa. Kehadiran himpunan tersebut menjadi wadah yang tepat bagi mahasiswa untuk bersosialisasi, menjalin relasi dengan banyak kenalan baru, serta mewujudkan ide dengan cara yang positif.&nbsp;</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><strong>Lakukan konseling bila membutuhkan</strong><br />\r\n	Prasmul juga menyediakan fasilitas&nbsp;<a href=\"https://www.prasetiyamulya.ac.id/konseling/\">konseling</a>&nbsp;yang memungkinkan mahasiswa melakukan konsultasi non akademik. Sesi konseling tersebut diharapkan bisa membantu mengatasi persoalan pribadi maupun interaksi sosial yang berpengaruh terhadap proses belajar. Klasifikasi layanan konseling Prasmul meliputi bimbingan rujukan, bimbingan kelompok, walk in konseling, serta online counseling. Selain konseling, mahasiswa juga patut menetapkan ekspektasi dan mengatur target pribadi secara realistis supaya tujuan tersebut mudah dicapai.&nbsp;</li>\r\n</ol>\r\n\r\n<ol>\r\n	<li><strong>Luangkan me time agar lebih rileks</strong><br />\r\n	Kesehatan mental berhubungan pula dengan waktu yang cukup bagi diri sendiri. Jadi, alangkah lebih baik jika Prasmulyan senantiasa meluangkan me time secara teratur supaya lebih rileks dan terhindar dari stres. Memanfaatkan me time untuk menekuni hobi atau kegiatan santai lainnya yang menyenangkan.&nbsp;</li>\r\n</ol>\r\n\r\n<p>Kestabilan mental mahasiswa yang terjaga adalah modal utama untuk meningkatkan kualitas generasi muda di tanah air. Semoga upaya Prasmul dalam mendukung kesehatan mental Prasmulyan menginspirasi berbagai pihak lain untuk melakukan hal serupa.<br />\r\n<br />\r\nSumber :&nbsp;https://www.prasetiyamulya.ac.id/mengatasi-tantangan-kesehatan-mental-mahasiswa/</p>\r\n', '../uploads/Mengatasi-Tantangan-Kesehatan-Mental-Mahasiswa-Universitas-Prasetiya-Mulya (1).jpg', '2024-01-24 03:24:39', '2024-05-14 03:12:32'),
(63, 'Mental Health Mahasiswa', '<p><em>Pentingnya Mengenal dan Memahami kesehatan Mental?</em></p>\r\n\r\n<p>(<strong>UINSGD.AC.ID</strong>)-Perubahan-perubahan social yang serba cepat sebagai konsekuensi modernisasi, industrialisasi, kemajuan ilmu, pengetahuan dan teknologi, mempunyai dampak pada kehidupan masyarakat. Perubahan-perubahan social tersebut telah mempengaruhi nilai kehidupan masyarakat. Tidak semua orang mampu menyesuaikan diri dengan perubahan-perubahan tersebut, yang pada gilirannya dapat menimbulkan ketegangan atau stress pada dirinya. Selain itu, dengan adanya wabah pandemic covid-19 memicu kesehatan mental masyarakat menjadi tidak menentu.</p>\r\n\r\n<p>Hal tersebut di atas adalah beberapa hal yang dapat merupakan sumber stress psikososial dalam masyarakat, yang pada gilirannya taraf kesehatan yang bersangkutan akan terganggu karenanya. Taraf kesehatan yang dimaksudkan disini adalah tidak semata-mata sehat dalam arti fisik, tetapi juga dalam arti mental, social, dan spiritual (WHO, 1984).</p>\r\n\r\n<p>Prof. T.A Lambo, direktur kesehatan jiwa WHO di dalam (9 th Word Congress of Social Psychiatry di Paris, 1982, mengutarakan bahwa kemajuan ilmu pengetahuan, teknologi dan modernisasi merupakan factor social ekonomi baru dalam bidang kesehatan. Kini masalah kesehatan tidak lagi hanya menyangkut beberapa angka kematian (mortalitas) atau angka kesakitan/penyakit (morbiditas), melainkan mencakup ruang lingkup kehidupan yang lebih luas, yaitu berbagai factor psikososial yang dapat dan merupakan stress kehidupan anggota masyarakat.</p>\r\n\r\n<p>Terdapat keadaan mental yang secara khusus perlu mendapat perhatian, yaitu &ldquo;sehat mental&rdquo;, &ldquo;mental tak sehat&rdquo; dan &ldquo;sakit mental&rdquo;.</p>\r\n\r\n<p>Sehat mental secara umum dapat diartikan sebagai kondisi mental yang tumbuh dan didasari motivasi yang kuat ingin meraih kualitas diri yang lebih baik, baik dalam kehidupan keluarga, kehidupan kerja, maupun sisi kehidupan lainnya.</p>\r\n\r\n<p>Mental tidak sehat ialah orang yang meskipun secara potensial memiliki kemampuan, tetapi tidak punya keinginan dan usaha untuk mengaktualisasikan potensinya itu secara optimal.</p>\r\n\r\n<p>Sakit mental adalah orang yang secara mental memiliki berbagai macam unsure yang saling bertentangan dan dengan demikian, sering merusak atau menghambat, sehingga perilakunya tidak menentu.</p>\r\n\r\n<p><em>Bagaimana Adaptasi Mahasiswa baru di Dunia Perkuliahan?</em></p>\r\n\r\n<p>Seorang mahasiswa dikategorikan pada tahap perkembangan yang usianya antara 18 sampai 25 tahun. Tahap ini dapat digolongkan pada masa remaja akhir sampai masa dewasa awal dan dilihat dari segi perkembangan, tugas perkembangan pada usia mahasiswa ini ialah pemantapan pendirian hidup.</p>\r\n\r\n<p>Mahasiswa dinilai memiliki tingkat intelektualitas yang tinggi, kecerdasan dalam berpikir dan kerencanaan dalam bertindak. Berpikir kritis dan bertindak dengan cepat dan tepat merupakan sifat yang cenderung melekat pada diri setiap mahasiswa, yang merupakan prinsip yang saling melengkapi.<br />\r\nMenurut Susantoro mahasiswa adalah merupakan kalangan muda yang berumur antara 19 sampai 28 tahun yang memang dalam usia tersebut mengalami suatu peralihan dari tahap remaja ke tahap dewasa.</p>\r\n\r\n<p><em>Karakteristik Mahasiswa?</em></p>\r\n\r\n<p>1. Stabilitas dalam kepribadian yang mulai meningkat, karena berkurangnya gejolak-gejolak yang ada didalam perasaan.<br />\r\n2. Mulai memantapkan dan berpikir dengan matang terhadap sesuatu yang akan diraihnya, sehingga mereka memiliki pandangan yang realistik tentang diri sendiri dan lingkungannya.<br />\r\n3. Mahasiswa akan cenderung lebih dekat dengan teman sebaya untuk saling bertukar pikiran dan saling memberikan dukungan, karena dapat kita ketahui bahwa sebagian besar mahasiswa berada jauh dari orang tua maupun keluarga.<br />\r\n4. Karakteristik mahasiswa yang paling menonjol adalah mereka mandiri, dan memiliki prakiraan di masa depan, baik dalam hal karir maupun hubungan percintaan. Mereka akan memperdalam keahlian dibidangnya masing-masing untuk mempersiapkan diri menghadapi dunia kerja yang membutuhkan mental tinggi.</p>\r\n\r\n<p><em>Bagaimana Mahasiswa Harus Beradaptasi dengan Situasi yang Baru?</em></p>\r\n\r\n<p>&ndash; Budaya Kampus<br />\r\n&ndash; Metode Pembelajaran<br />\r\n&ndash; Media Pembelajaran<br />\r\n&ndash; Pengajar / Dosen<br />\r\n&ndash; KRS-an</p>\r\n\r\n<p><em>Penyebab salah jurusan?</em></p>\r\n\r\n<p>1. Tidak ditelusuri dulu minat bakal.<br />\r\n2. Ikut-ikutan teman.<br />\r\n3. Masuk karena pilihan yang kedua, tapi tidak sesuai harapan.<br />\r\n4. Kurang mendaptkan informasi terkait jurusan yang dipilih.<br />\r\n5. Asal kuliah saja.<br />\r\n6. Ikut ramenya sekarang jurusan apa yang diminati.<br />\r\n7. Karena paksaan orang tua.</p>\r\n\r\n<p><em>Aapa yang harus dilakukan?</em></p>\r\n\r\n<p>1. Koordinasikan dengan pembimbing akademik komunikasikan kesulitan yang dihadapi<br />\r\n2. Untuk memastikan minat bakat, lakukan psikotest minat bakat agar lebih terarah<br />\r\n3. Jika dirasakan tidak bisa menjalani sebaiknya pindah jurusan<br />\r\n4. Komunikasikan dengan orang tua<br />\r\n5. Deteksi sejak dini kesulitan kesulitan perkuliahan.<br />\r\n<br />\r\nSumber :&nbsp;https://uinsgd.ac.id/mental-health-mahasiswa/</p>\r\n', '../uploads/89aa8f2a.jpg', '2024-01-25 14:15:09', '2024-05-14 03:12:44'),
(64, 'Pentingnya Menjaga Kesehatan Mental Bagi Mahasiswa', '<p>Organisasi Kesehatan Dunia (WHO) mengungkapkan bahwa 1 miliar orang di dunia hidup dengan gangguan mental. Menurut rilis WHO dalam rangka peringatan Hari Kesehatan Mental Sedunia tahun 2020 pada tanggal 10 Oktober menyatakan bahwa 3 juta orang meninggal setiap tahunnya akibat penggunaan alkohol dan setiap 40 detik satu orang meninggal karena bunuh diri. WHO mencatat negara dengan penghasilan rendah dan menengah, lebih dari 75 persen orang dengan gangguan mental, neurologis dan penyalahgunaan zat tidak menerima pengobatan yang sesuai kondisi mereka.</p>\r\n\r\n<p>Situasi pandemik covid-19 saat ini, membuat pembahasan tentang kesehatan mental menjadi perbincangan menarik. Dengan segala perubahan yang terjadi karena pandemi virus corona, masyarakat dunia perlu menyesuaikan diri. Kesehatan mental mengacu pada kesejahteraan kognitif, perilaku, dan emosional. Hal inilah yang mengatur bagaimana cara orang berpikir, merasakan, dan berperilaku. Selain itu, kesehatan mental juga dapat memengaruhi kehidupan sehari-hari, hubungan atau relasi, dan kesehatan fisik.</p>\r\n\r\n<p>Data terbaru yang dirilis oleh WHO saat pandemi corona, menunjukkan adanya penambahan kasus gangguan kesehatan mental secara signifikan di sejumlah negara. Menurut data dari situs resmi WHO, mereka melakukan survei di 130 negara. Hasilnya, ada dampak buruk Covid-19 pada akses layanan kesehatan mental. Hasil survei WHO menyatakan lebih dari 60% melaporkan gangguan layanan kesehatan mental bagi orang-orang yang rentan, termasuk anak-anak dan remaja (70%); orang dewasa yang lebih tua (70%), dan wanita yang membutuhkan layanan antenatal atau postnatal (61%). Sebanyak 67% melihat gangguan pada konseling dan psikoterapi; 65% untuk layanan pengurangan bahaya kritis; dan 45% untuk pengobatan pemeliharaan agonis opioid untuk ketergantungan opioid. Lebih dari sepertiga (30%) melaporkan gangguan pada intervensi darurat, termasuk orang yang mengalami kejang berkepanjangan, sindrom penarikan penggunaan zat yang parah, dan delirium, seringkali merupakan tanda kondisi medis serius yang mendasari. Ada 30% negara yang melaporkan gangguan akses pengobatan untuk gangguan mental, neurologis dan penggunaan zat. Sekitar 75% negara melaporkan setidaknya sebagian gangguan terjadi di sekolah (78%), dan tempat kerja layanan kesehatan mental (75%).</p>\r\n\r\n<p>Beberapa bulan ke belakang, kesadaran masyarakat Indonesia dalam isu kesehatan mental dinilai terus meningkat. Di Indonesia, Data Riset Kesehatan Dasar (Riskesdas) 2013 memunjukkan prevalensi ganggunan mental emosional yang ditunjukkan dengan gejala-gejala depresi dan kecemasan untuk usia 15 tahun ke atas mencapai sekitar 14 juta orang atau 6% dari jumlah penduduk Indonesia. Sedangkan prevalensi gangguan jiwa berat, seperti skizofrenia mencapai sekitar 400.000 orang atau sebanyak 1,7 per 1.000 penduduk. Sementara data Riset Kesehatan Dasar yang dilakukan Kementerian Kesehatan pada 2018 menemukan bahwa prevalensi orang gangguan jiwa berat (skizofrenia/psikosis) meningkat dari 0,15% menjadi 0,18%, sementara prevalensi gangguan mental emosional pada penduduk usia 15 tahun keatas meningkat dari 6,1% pada tahun 2013 menjadi 9,8 persen pada 2018. Sementara itu prevalensi gangguan mental emosional pada remaja berumur &gt;15 tahun sebesar 9,8%. Angka jni meningkat dibandingkan tahun 2013 yaitu sebesar 6%.</p>\r\n\r\n<p>Masalah kesehatan mental di Indonesia pada masa ini masih tergolong sangat tinggi, terutama pada kalangan remaja karena mereka masih memiliki emosi yang tidak stabil dan belum memiliki kemampuan yang baik untuk memecahkan masalah yang ada. Masa remaja merupakan masa dimana mereka sering mengalami stres terutama pada peristiwa-peristiwa tertentu dalam hidup mereka. Remaja dianggap sebagai golongan yang rentan untuk mengalami gangguan mental. Oleh karena itu, remaja perlu untuk mendapatkan perhatian lebih karena remaja merupakan aset negara dan generasi penerus bangsa.</p>\r\n\r\n<p>Kesehatan mental pada mahasiswa dapat dipengaruhi oleh beberapa faktor, diantaranya yaitu faktor genetika, keluarga, pertemanan, gaya hidup, sosial, dan berbagai faktor lainnya. Faktor-faktor tersebut dapat mempengaruhi mahasiswa secara positif maupun negatif. Akan tetapi, masih banyak mahasiswa yang tidak menyadari dampak positif dan negatif yang ditimbulkan dari faktor-faktor tersebut sehingga mereka lupa akan kesehatan mental mereka. Mereka lupa untuk berfokus pada kesehatan mental mereka karena mereka hanya berfokus pada tugas, organisasi, jadwal kuliah, serta tuntutan-tuntutan yang ia terima dari orang-orang di sekitarnya. Regulasi diri dalam belajar yang baik akan membantu mahasiswa untuk memenuhi tuntutan-tuntutan yang dihadapinya. Regulasi diri adalah kemampuan seseorang untuk melakukan kontrol terhadap emosi dan perilakunya di situasi apapun secara mandiri.</p>\r\n\r\n<p>Pada awal masa COVID-19, pemerintah resmi menyatakan bahwa semua instansi pendidikan akan melaksanakan pembelajaran secara daring (media dalam jaringan) pada bulan Maret 2020. Berawal dari kuliah daring, kita dapat melihat bagaimana dampak yang ditimbulkan terhadap para mahasiswa melalui kuliah daring tersebut, terutama pada mahasiswa baru. Seharusnya, masa perkuliahan awal merupakan kesempatan bagi mahasiwa baru untuk mencari relasi, mengembangkan diri, serta belajar untuk menjadi lebih mandiri. Akan tetapi, sekarang hal itu menjadi lebih sulit untuk dilakukan karena ketidakmampuan mahasiswa untuk berinteraksi secara langsung sehingga hal-hal yang seharusnya menjadi kesempatan emas bagi mahasiswa baru pun hilang.</p>\r\n\r\n<p>Kesehatan mental memiliki peranan yang sangat penting bagi mahasiswa baru untuk beradaptasi dengan lingkungan perkuliahannya yang baru. Tentunya kehidupan di lingkungan kampus dan sekolah jauh berbeda. Mahasiswa baru akan menemukan berbagai macam pergaulan yang sangat beragam serta akan menemukan metode pembelajaran yang berbeda dibanding masa sekolah. Oleh karena itu, secara tidak langsung mahasiswa baru dituntut untuk bisa beradaptasi terhadap lingkungan barunya. Selain mahasiswa baru, mahasiswa lama pun mengalami beberapa dampak yang diakibatkan oleh kuliah daring, terutama bagi mahasiswa yang mengikuti organisasi. Dengan adanya kuliah daring, maka secara otomatis tugas-tugas perkuliahan pun akan semakin banyak.</p>\r\n\r\n<p>Menurut paparan dari WHO pada tahun 2019, belakangan ini stress lebih sering muncul terjadi karena beberapa hal sebagai berikut,</p>\r\n\r\n<ol>\r\n	<li>Ketakutan dan kecemasan mengenai kesehatan diri maupun kesehatan orang lain yang disayangi</li>\r\n	<li>Perubahan pola tidur dan pola makan</li>\r\n	<li>Sulit tidur dan konsentrasi</li>\r\n	<li>Menggunakan obat-obatan</li>\r\n</ol>\r\n\r\n<p>Hal ini juga serupa dengan penyebab dari perubahan kesehatan mental pada kalangan Mahasiswa di Indonesia. Ironinya hal ini acap kali terjadi dan dianggap lazim di masyarakat. Sebagaimana kita mengetahui dampak yang diberikan oleh perubahan kesehatan mental yang sangat patut diwaspadai. Maka dari itu berikut tips dan trik yang bisa dilakukan teman-teman Mahasiswa di rumah.</p>\r\n\r\n<ol>\r\n	<li><strong>Pendekatan spiritual</strong>, ketahui hal mana saja yang dapat kita kendalikan dan tidak dapat kita kendalikan. Dengan mengetahui hal tersebut dan selalu bersandar kepada Sang Maha Kuasa membuat hati lebih tenang</li>\r\n	<li><strong>Olahraga teratur</strong>, usahakan untuk melakukan olahraga tiap harinya sesuai dengan kebutuhan tubuh masing masing. Berolahraga terbukti menurunkan jumlah hormon kortisol yang menjadi pemicu stress dalam tubuh</li>\r\n	<li><strong>Selalu terhubung dengan&nbsp;</strong><strong><em>social support,&nbsp;</em></strong>tiap kali ada persoalan atau tidak tetap rutin hubungi keluarga sekaligus bila rasa dukungan sosial belum mampu teratasi, jangan ragu untuk menghubungi bantuan tenaga profesional</li>\r\n</ol>\r\n\r\n<p>Penting bagi kita semua untuk sama sama menjadi Mahasiswa yang tangguh dan sehat mental. Saatnya satu sama lain saling peduli dan meningkatkan rasa empati. Dengan beberapa cara di atas besar harapannya bisa membantu untuk tetap menjaga kondisi kesehatan mental Mahasiswa.</p>\r\n\r\n<p>Sumber :&nbsp;https://gc.ukm.ugm.ac.id/2021/05/pentingnya-menjaga-kesehatan-mental-bagi-mahasiswa/</p>\r\n', '../uploads/HIV-AIDS-Vaccine-One-Step-Further-to-Cure-theIncurable-300x300.png', '2024-01-25 14:25:02', '2024-05-14 03:12:59'),
(65, 'Menjadi Isu Global, Ini Pentingnya Kesehatan Mental Mahasiswa dan Pelajar', '<p>Agar bisa menempuh pendidikan dengan lancar dan fokus belajar, seluruh pelajar harus dalam keadaan yang sehat baik secara fisik maupun mental. Kesehatan mental para pelajar adalah salah satu hal penting yang harus dijaga agar jalan mereka mewujudkan mimpi tidak terhambat. Namun nyatanya banyak sekali pelajar dari segala usia mengalami tekanan pada kesehatan mental mereka. Terutama para mahasiswa internasional yang terjadi pada beberapa kasus dari berbagai negara. Sebenarnya seperti apa sih kesehatan mental itu alias&nbsp;<em>mental health</em>? Dan apa yang harus dilakukan agar kesehatan mental para pelajar dan mahasiswa bisa terjaga dengan baik?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Tentang Kesehatan Mental Pelajar dan Mahasiswa</strong></p>\r\n\r\n<p>Menurut Organisasi Kesehatan Dunia (WHO), kesehatan mental adalah keadaan sejahtera di mana setiap individu bisa mewujudkan potensi mereka sendiri. Artinya, mereka dapat mengatasi tekanan kehidupan yang normal, dapat berfungsi secara produktif dan bermanfaat, serta mampu memberikan kontribusi kepada komunitas mereka. Namun nyatanya sering terjadi peristiwa yang kemudian berdampak pada rasa trauma akibat kekerasan, tekanan berlebih, ataupun stress dalam jangka panjang.</p>\r\n\r\n<p>Jika kesehatan mental terganggu, maka timbul gangguan mental atau penyakit mental. Gangguan mental dapat mengubah cara seseorang dalam menangani stres, berinteraksi dengan orang lain, membuat pilihan, dan memicu hasrat untuk menyakiti diri sendiri. Jika dibiarkan tentu hal ini akan sangat membahayakan apalagi di kalangan para pelajar dan mahasiswa yang seharusnya bisa mengenyam pendidikan dengan akal yang sehat demi masa depan yang lebih baik.&nbsp;</p>\r\n\r\n<p>Berdasarkan penelitian internasional, isu kesehatan mental mahasiswa maupun siswa kini menjadi masalah utama di beberapa negara. Hal ini terjadi karena memang gangguan ini bisa menyerang siapa saja apapun latar belakangnya. Catatan&nbsp;<em>Mozaic Science</em>&nbsp;melalui&nbsp;<em>World Economic Forum (WEF)</em>&nbsp;menyebutkan jumlah mahasiswa di Inggris yang mengunjungi bagian konseling kampus meningkat hampir lima kali dibandingkan 10 tahun lalu. Begitu juga di Amerika Serikat, depresi dan kecemasan dikalangan anak dibawah 17 tahun jadi bermunculan. Sedangkan untuk usia mahasiswa, permintaan konseling jadi meningkat. Mahasiswa memang rentan terkena masalah kesehatan mental karena harus bergulat dengan lingkungan sosial baru, menghadapi tuntutan untuk meniti karier, hingga problem keuangan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Di Indonesia sendiri masalah kesehatan mental pelajar menjadi perhatian lebih sejak pandemi Covid 19 terjadi. Sejak diharuskannya Pembelajaran Jarak jauh, tercatat kasus kecemasan dan kesehatan mental pelajar dan mahasiswa meningkat menjadi 63,6% akibat pandemi.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Tips Menjaga Kesehatan Mental Pelajar</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Olahraga Teratur</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Biasanya saat seseorang mengalami kecemasan dan masalah pada kesehatan mental, muncul pikiran negatif yang mengganggu. Untuk menekan itu semua kamu bisa mengalihkan perhatian kamu dengan berolahraga. Dengan berolahraga makan hormon endorfin yang akan menekan laju hormon kortisol penyebab stress.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Lakukan Hobi</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Dengan melakukan ini, kamu bisa lebih meningkatkan mood atau suasana hatimu karena memang hobi tersebut adalah hal yang kamu sukai. Rasa pressure yang kamu hadapi juga bisa berkurang dan terganti dengan perasaan yang lebih positif.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Mencari Support Sistem</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Untuk memperkuat kesehatan mental dalam jangka panjang, kamu bisa bergabung dengan komunitas-komunitas terntentu yang memberikan dukungan pada mahasiswa yang mengalami depresi dan stress. Dengan menjalin hubungan positif dengan lingkungan yang tepat, kamu jadi merasa tak sendiri menghadapi masalah yang kamu alami.</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p><strong>Mencari Bantuan Profesional</strong></p>\r\n	</li>\r\n</ul>\r\n\r\n<p>Jika masalah kesehatan mental terlanjur menyerang mu, jangan berusaha untuk menyangkalnya. Segeralah mencari bantuan profesional seperti bagian konseling di universitas atau psikolog. Jangan menyimpulkan diagnosa sendiri ya, karena akan berdampak semakin parah terhadap kesehatan mental kamu.</p>\r\n\r\n<p>Bagaimana jika kamu mendapati teman mu mengalami masalah kesehatan mental? Kamu bisa mendampinginya untuk mencari bantuan profesional. Dengan tidak menyudutkan dan memaksa lebih jauh, dukungan yang tulus dari orang terdekatlah yang bisa menyelamatkan mereka dari tindakan yang merugikan masa depannya.<br />\r\n<br />\r\nSumber :&nbsp;https://www.hotcourses.co.id/study-abroad-info/student-life/ini-pentingnya-kesehatan-mental-mahasiswa-dan/</p>\r\n', '../uploads/kemenkes-mesti-ikut-andil-atasi-siswa-depresi-karena-pjj-tji3ymmNpv.jpg', '2024-01-25 14:28:34', '2024-01-25 14:28:34'),
(70, 'Pentingnya Menjaga Kesehatan Mental Mahasiswa', '<p>Kesehatan mental dan fisik berperan penting dalam kemampuan seorang mahasiswa untuk mencapai kesuksesan dalam berbagai aspek kehidupan. Tidak hanya berkaitan dengan keberhasilan akademik, kesehatan mental mahasiswa juga berhubungan erat dengan kualitas hidup dan perkembangan pribadi.</p>\r\n\r\n<h2>Pentingnya Kesehatan Mental</h2>\r\n\r\n<p>Berikut adalah beberapa aspek kunci mengapa kesehatan mental berperan penting bagi mahasiswa:</p>\r\n\r\n<h3>Kinerja Akademik</h3>\r\n\r\n<p>Kesehatan mental seorang mahasiswa secara langsung memengaruhi kinerja akademik mereka. Ketika mahasiswa sehat secara mental, mereka dapat fokus menyerap informasi dengan lebih baik. Sebaliknya, masalah pada mental dapat menghambat proses pembelajaran.</p>\r\n\r\n<h3>Ketangguhan Emosional</h3>\r\n\r\n<p>Kesehatan mental juga memberikan mahasiswa ketangguhan emosional. Mereka akan mampu menghadapi stres dan tantangan dengan lebih efektif. Ini adalah keterampilan berharga yang akan memberi manfaat bagi perjalanan akademik mahasiswa dan dalam karier mereka di masa depan.</p>\r\n\r\n<h3>Kesiapan Karier</h3>\r\n\r\n<p>Mental yang prima akan meningkatkan kesiapan seorang mahasiswa untuk menghadapi tantangan dunia profesional. Mereka dapat mengelola waktu, bekerja dengan baik dalam tim, dan beradaptasi dengan perubahan. Semua keterampilan ini sangat dibutuhkan dalam dunia kerja.</p>\r\n\r\n<h3>Kualitas Hidup</h3>\r\n\r\n<p>Pada akhirnya, kesehatan mental mahasiswa akan menghasilkan kualitas hidup yang lebih baik pula. Ini tidak hanya berkaitan dengan kesuksesan akademik dan karier, tetapi juga dengan kepuasan batin.<br />\r\n<br />\r\n&nbsp;</p>\r\n\r\n<h2>Cara Memastikan Kesehatan Mental Mahasiswa</h2>\r\n\r\n<p>Memastikan kesehatan mental adalah suatu hal yang penting dalam menjalani kehidupan yang seimbang dan bermakna. Berikut adalah beberapa cara untuk memastikan kesehatan mental Anda:</p>\r\n\r\n<ul>\r\n	<li>Melakukan aktivitas fisik secara teratur.</li>\r\n	<li>Makan makanan sehat dan seimbang.</li>\r\n	<li>Tidur yang cukup untuk pemulihan fisik dan mental.</li>\r\n	<li>Temukan teknik-teknik pengelolaan stres yang sesuai untuk Anda, seperti meditasi, yoga, atau pernapasan.</li>\r\n	<li>Berbicara dengan teman, keluarga, atau seorang profesional ketika merasa tertekan.</li>\r\n	<li>Cobalah untuk menjaga hubungan dengan teman dan keluarga, serta bergabung dalam kegiatan sosial.</li>\r\n	<li>Hindari konsumsi alkohol dan narkoba</li>\r\n</ul>\r\n\r\n<p>Kesimpulanya, kesehatan mental memiliki dampak mendalam pada perkembangan akademik dan kehidupan mahasiswa di masa depan. STIKes Husada Borneo adalah salah satu institusi pendidikan yang selalu berusaha memaastikan &nbsp;kesehatan mental mahasiswanya. Jika Anda ingin mendaftar tempat kuliah STIKes Kalsel terbaik ini, kunjungi&nbsp;<a href=\"https://stikeshb.ac.id/\">stikeshb.ac.id</a>&nbsp;atau ikuti&nbsp;<a href=\"https://instagram.com/stikeshb\">@stikeshb</a>&nbsp;di Instagram.<br />\r\n<br />\r\nSumber :&nbsp;https://stikeshb.ac.id/pentingnya-menjaga-kesehatan-mental-mahasiswa/&nbsp;</p>\r\n', '../uploads/pexels-liza-summer-6382634.jpg', '2024-05-14 03:12:14', '2024-05-14 03:12:14'),
(71, 'Kesehatan Mental (Mental Health): Penyebab & Cara Menjaganya', '<p>Kesehatan mental atau yang juga dikenal dengan mental health adalah kondisi kesehatan yang berkaitan dengan aspek kejiwaan, psikis, dan emosional seseorang. Mental health mencerminkan keadaan kesehatan mental seseorang, termasuk tingkat keseimbangan emosional, kemampuan mengatasi tekanan, dan kualitas hubungan interpersonal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seseorang dapat dikatakan memiliki good mental health adalah apabila memiliki ketenangan jiwa dalam menjalani hidupnya. Sebaliknya, seseorang yang kesehatan mentalnya terganggu akan merasa kesulitan dalam mengendalikan emosinya bahkan dapat memengaruhi hubungannya dengan orang lain, kemampuannya dalam berpikir, atau bahkan memicu munculnya keinginan untuk melukai diri sendiri.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Mari simak lebih lanjut apa itu mental health , penyebab, gejala hingga cara mencegah gangguan mental melalui ulasan di bawah ini.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Apa itu Kesehatan Mental (Mental Health)?<br />\r\n&nbsp;</p>\r\n\r\n<p>Good mental health atau kondisi yang baik pada mental health adalah kondisi ketika kejiwaan dan pikiran dalam keadaan tenang dan damai. Kondisi ini memungkinkan seseorang untuk berpikir lebih jernih dan fokus saat beraktivitas. Sama halnya dengan kesehatan fisik, kesehatan mental juga penting untuk dijaga.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Seseorang dengan kesehatan mental yang baik mampu mengoptimalkan potensi dirinya dalam menghadapi permasalahan hidup, tantangan, hingga menjalin hubungan yang positif dengan orang lain. Sementara itu, kondisi mental yang terganggu dapat berdampak buruk terhadap emosi, suasana hati, dan kemampuan seseorang dalam berpikir.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tanpa adanya penanganan yang tepat, kondisi mental yang terganggu dapat memicu permasalahan dalam kehidupan sehari-hari yang akhirnya memengaruhi kualitas hidup penderitanya, seperti menurunnya produktivitas di tempat kerja atau prestasi di sekolah hingga merusak hubungan sosial dengan orang lain.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Maka dari itu, setiap individu diimbau untuk mulai memelihara kesehatan mentalnya dan belajar mengenali gejala-gejala atau tanda dari gangguan mental sedari dini, tanpa berpikir bahwa gangguan kejiwaan merupakan suatu hal yang tabu atau aib untuk diperbincangkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Penyebab Gangguan Kesehatan Mental<br />\r\n&nbsp;</p>\r\n\r\n<p>Saat seseorang mengalami gangguan kesehatan mental atau kondisi mental health yang kurang baik, tentu ada pemicunya, salah satunya penyebab mental health adalah trauma akibat peristiwa buruk yang terjadi di masa lalu. Adapun beberapa penyebab mental health adalah:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Riwayat gangguan kesehatan jiwa dalam keluarga atau faktor genetik.</p>\r\n\r\n<p>Tinggal di lingkungan perumahan yang tidak sehat.</p>\r\n\r\n<p>Adanya riwayat kekerasan seksual, fisik, atau bentuk pelecehan lainnya.</p>\r\n\r\n<p>Korban diskriminasi dan stigma.</p>\r\n\r\n<p>Terasingkan atau terisolasi secara sosial atau merasa kesepian.</p>\r\n\r\n<p>Stres berat dalam jangka waktu yang lama.</p>\r\n\r\n<p>Cedera pada kepala.</p>\r\n\r\n<p>Gangguan pada otak atau kelainan pada senyawa kimia di otak.</p>\r\n\r\n<p>Mengalami kerugian besar dalam hal ekonomi, seperti mengalami kebangkrutan atau memiliki utang.</p>\r\n\r\n<p>Kehilangan pekerjaan, pengangguran, atau tunawisma.</p>\r\n\r\n<p>Kematian atau kehilangan orang yang sangat disayangi.</p>\r\n\r\n<p>Penyalahgunaan obat-obatan terlarang atau konsumsi alkohol secara berlebihan.</p>\r\n\r\n<p>Memiliki trauma berat, seperti mengalami kecelakaan serius atau berada dalam situasi peperangan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gejala Gangguan Kesehatan Mental<br />\r\n&nbsp;</p>\r\n\r\n<p>Ciri-ciri gangguan mental yang dialami seseorang dapat berbeda-beda, tergantung dari jenis penyakit mental yang dideritanya. Namun, terdapat beberapa gejala umum yang dapat dialami oleh penderita kesehatan mental adalah:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sulit fokus dan berkonsentrasi.</p>\r\n\r\n<p>Kesulitan dalam mengatasi stres atau masalah sehari-hari.</p>\r\n\r\n<p>Mudah emosi secara berlebihan dan rentan melakukan kekerasan.</p>\r\n\r\n<p>Suka berteriak atau berkelahi.</p>\r\n\r\n<p>Sering berhalusinasi atau menjadi paranoid.</p>\r\n\r\n<p>Menarik diri dari aktivitas sosial.</p>\r\n\r\n<p>Kehilangan semangat dan minat untuk melakukan aktivitas yang awalnya disukai.</p>\r\n\r\n<p>Muncul pikiran untuk menyakiti diri sendiri (self harm) atau orang lain.</p>\r\n\r\n<p>Munculnya pikiran untuk bunuh diri (suicidal thoughts).</p>\r\n\r\n<p>Munculnya perubahan suasana hati secara tiba-tiba.</p>\r\n\r\n<p>Perubahan kebiasaan atau pola makan, seperti tidak nafsu makan atau justru makan secara berlebihan.</p>\r\n\r\n<p>Munculnya perasaan cemas, takut, khawatir, putus asa, dan sedih secara berlebihan.</p>\r\n\r\n<p>Sering merasa lelah dan mengalami masalah tidur.</p>\r\n\r\n<p>Perubahan gairah seks.</p>\r\n\r\n<p>Rutinitas sehari-hari terganggu dan produktivitas atau prestasi menurun.</p>\r\n\r\n<p>Sulit memahami kondisi orang lain.</p>\r\n\r\n<p>Merasa kebingungan, mudah lupa, dan mudah tersinggung.</p>\r\n\r\n<p>Hilangnya rasa percaya diri.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Diagnosis Gangguan Kesehatan Mental<br />\r\n&nbsp;</p>\r\n\r\n<p>Dokter akan mendiagnosis pasien gangguan kesehatan mental atau mental health adalah dengan cara melakukan anamnesis atau wawancara medis untuk mengetahui gejala perilaku, pengalaman hidup, riwayat kesehatan, riwayat konsumsi obat-obatan, serta riwayat penyakit dalam keluarga.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Selanjutnya, proses diagnosa mental health adalah pemeriksaan fisik, dimana untuk memastikan tidak ada indikasi atau gejala dari penyakit lain. Dalam beberapa kasus, dokter akan melakukan pemeriksaan penunjang, seperti skrining obat-obatan dan alkohol, pemeriksaan fungsi tiroid, dan CT scan untuk memastikan tidak ada masalah pada otak.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pemeriksaan secara menyeluruh untuk gangguan mental health adalah penting untuk dilakukan, guna membantu dokter dalam menetapkan diagnosis dan penanganan yang dibutuhkan pasien.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pengobatan Gangguan Kesehatan Mental<br />\r\n&nbsp;</p>\r\n\r\n<p>Terdapat sejumlah metode pengobatan yang dapat direkomendasikan dokter untuk membantu pasien dalam mengelola atau mengatasi kondisi gangguan kesehatan mental mereka. Metode yang digunakan dipilih berdasarkan kondisi kesehatan mental dari masing-masing pasien. Beberapa pengobatan tersebut adalah:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>1. Konsumsi Obat-obatan<br />\r\n&nbsp;</p>\r\n\r\n<p>Pemberian obat-obatan harus sesuai dengan resep dokter dan bertujuan untuk mengatasi gejala gangguan mental akibat adanya kelainan senyawa kimia pada otak. Biasanya, dokter juga akan meminta pasien untuk menjalani psikoterapi agar hasil pengobatan lebih efektif dan optimal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Jenis obat-obatan yang umumnya diresepkan dokter adalah obat-obatan golongan antidepresan trisiklik, selective serotonin reuptake inhibitor (SSRI), dan serotonin-norepinephrine reuptake inhibitor (SNRIs).&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>2. Psikoterapi<br />\r\n&nbsp;</p>\r\n\r\n<p>Melalui psikoterapi, pasien dapat menyampaikan perasaan serta pikirannya dan dokter akan memberikan saran yang sesuai. Biasanya, dokter akan membimbing pasien dalam mengontrol perasaan dan mengelola emosi serta perilakunya.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Contoh psikoterapi yang sering digunakan untuk menangani gangguan kesehatan mental adalah exposure therapy, dialectical behavior therapy, dan cognitive behavioral therapy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>3. Supporting Group<br />\r\n&nbsp;</p>\r\n\r\n<p>Pasien dengan gangguan kesehatan mental biasanya juga disarankan untuk bergabung ke dalam supporting group atau kelompok dukungan. Kelompok ini terdiri dari orang-orang yang juga menderita gangguan mental atau individu yang sudah sembuh dari penyakitnya. Melalui kegiatan ini, mereka diharapkan dapat saling berbagi pengalaman dan saran sehingga proses pemulihan pun dapat berjalan secara optimal.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>4. Stimulasi pada Otak<br />\r\n&nbsp;</p>\r\n\r\n<p>Stimulasi pada otak terdiri dari beberapa jenis, yaitu stimulasi magnetik transkranial, stimulasi saraf vagus, elektrokonvulsif, dan stimulasi otak dalam. Metode terapi ini dinilai efektif untuk membantu pasien dalam mengatasi masalah gangguan mental yang dialaminya.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>5. Rehabilitasi<br />\r\n&nbsp;</p>\r\n\r\n<p>Metode rehabilitasi biasanya diberikan pada pasien yang mengalami masalah mental health akibat penyalahgunaan obat-obatan terlarang. Cara ini bertujuan untuk menghentikan ketergantungan pasien terhadap obat-obatan tersebut.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>6. Perawatan di Rumah Sakit<br />\r\n&nbsp;</p>\r\n\r\n<p>Apabila dibutuhkan pengawasan ketat dari tenaga medis, pasien dapat disarankan untuk menjalani perawatan intensif di rumah sakit. Biasanya hal ini dilakukan untuk mencegah terjadinya kondisi gawat darurat, seperti percobaan bunuh diri.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>7. Perawatan Mandiri<br />\r\n&nbsp;</p>\r\n\r\n<p>Tidak hanya melalui bantuan medis atau terapi, pasien dengan masalah mental health juga dapat menjalani perawatan secara mandiri. Hal ini dapat dilakukan dengan menerapkan pola hidup sehat serta mengelola stres dengan baik.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Cara Menjaga Kesehatan Mental<br />\r\n&nbsp;</p>\r\n\r\n<p>Cara menjaga kesehatan mental sebetulnya tak jauh berbeda dengan cara-cara yang diterapkan untuk menjaga kesehatan fisik, yaitu dengan menerapkan pola hidup sehat, seperti:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Berpikir dan memberikan afirmasi positif untuk diri sendiri.</p>\r\n\r\n<p>Mengelola stres dengan baik.</p>\r\n\r\n<p>Rutin berolahraga.</p>\r\n\r\n<p>Menjaga hubungan baik dengan orang lain.</p>\r\n\r\n<p>Tidur dan istirahat cukup.</p>\r\n\r\n<p>Saling membantu dan memahami kondisi orang lain.</p>\r\n\r\n<p>Mencari bantuan tenaga medis profesional jika dibutuhkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Gangguan kesehatan mental perlu segera ditangani dengan tenaga medis profesional guna menghindari terjadinya penurunan kualitas hidup. Mulai ceritakan permasalahan Anda dengan psikolog atau psikater secara online melalui layanan Telekonsultasi dan dapatkan saran perawatan yang tepat sesuai kondisi Anda. Download aplikasi MySiloam sekarang untuk mengakses layanan Telekonsultasi.</p>\r\n\r\n<p>Sumber :&nbsp;https://www.siloamhospitals.com/informasi-siloam/artikel/apa-itu-mental-health</p>\r\n', '../uploads/website-cms-16980542352609237.webp', '2024-05-14 03:15:11', '2024-05-14 03:15:11');
